import style from '../Styles/Detail.module.css';

function Detail() {
  return (
    <div>
      <div id={style.wrap}>
        <img className={style.bigprofile}
        src="C:\Users\khj00\OneDrive\바탕 화면\new-clone\TTS\frontend\src\Images\download.jpg" alt="profile"></img>
      </div>
    </div>
  )
}

export default Detail
